  [],\n\t\"revision_timestamp\": \"2016-08-20T09:39:36.664766\",\n\t\"name\": \"mid-columbia-invasive-species-management-with-volunteers\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Project will initiate a program for the
  early detection, monitoring and mapping of invasive species on McNary and Umatilla
  NWR's using Refuge volunteers. The initial program will center on the recruitment,
  training, and management of volunteers in partnership with the Refuge Friends Group
  Friends of the Mid-Columbia River Wildlife Refuges. Priority species that are not
  prevalent but pose a future threat, and for which an early detection early response
  program would be most beneficial include rush skeletonweed, tamarisk, and yellow
  starthistle. Monitoring and mapping of more established and widespread weeds such
  as phragmites and false indigo would also benefit from the program. The initial
  year wouldinitiate the recruiting and training of volunteers on the operation of
  hand held GPS equipment, weed identification, monitoring protocols and data entry.\",\n\t\"license_title\":
